function cloneMore(a,b){var c=$(a).clone(!0),d=$("#id_"+b+"-TOTAL_FORMS").val();c.find(":input").each(function(){var a=$(this).attr("name").replace("-"+(d-1)+"-","-"+d+"-"),b="id_"+a;$(this).attr({name:a,id:b}).val("").removeAttr("checked")}),d++,$("#id_"+b+"-TOTAL_FORMS").val(d),c.find(".number").text(d),$(a).after(c)}$(document).ready(function(){$("#add_more_problems").click(function(){cloneMore("div.problem-form:last","servicerequestproblem_set")}),$("#add_more_images").click(function(){$(".fileinput").first().clone().appendTo("#images")})});